import React from 'react'

function TimePicker() {

    let hour = [...Array(12)].map((v,i) => i);
    let minute = [...Array(60)].map((v,i) => i);

    console.log(hour, minute);

    return (
        <div>
            <div className="TimePicker-hour">
            {hour}
            </div>

            <div className="TimePicker-minute">
            {minute}
            </div>

        </div>
    )
}

export default TimePicker
